                </div>
                <div className = "modal">
                    <h4>Create invoce</h4>

                    <div className = "parameter">
    					<p>Дата</p>
    					<input type = "date" className = "parameterInput" ref="date"></input>
    				</div>

                </div>
            </div>
		)
	}
}

export default Modal;
